css:
@-moz-document domain(github.com) {
    pre {
        background-color: #2b3e50 !important;
        color: #f8f8f2 !important;
        font-size: 95% !important;
        font-family: monospace;
        font-weight: 450;
    }


    .pl-k {
        color: #ff6541;
    }

    .pl-c1,
    .pl-s .pl-v {
        color: #ca94ff;
    }

    .pl-smi,
    .pl-s .pl-s1 {
        color: #ffb86c;
    }

    .pl-c {
        color: #5c98cd;
    }

    .pl-e,
    .pl-en {
        color: #72c05d
    }

    .pl-s,
    .pl-pds,
    .pl-s .pl-pse .pl-s1,
    .pl-sr,
    .pl-sr .pl-cce,
    .pl-sr .pl-sre,
    .pl-sr .pl-sra {
        color: #e6db74;
    }
}
